}


const fetchVolunteersSkills = async () => {
    try {
      const response = await fetch('http://localhost:8000/volunteersSkills'); // The URL address of the API in the Node.js server
      const data = await response.json();
      return data;
    } catch (err) {
      console.error(err);
      return null;
